import { join } from 'path';
import { homedir } from 'os';

export default {
  name: 'get_agent_profile',
  description: 'Load agent profile and specialization info',

  parameters: {
    type: 'object',
    properties: {
      agentId: {
        type: 'string',
        description: 'Agent ID (e.g., code-expert, data-analyst)'
      }
    },
    required: ['agentId']
