    try {
      const profilePath = join(
        homedir(),
        '.openclaw',
        'agent-profiles',
        `${agentId}.json`
      );

      const profile = JSON.parse(
        readFileSync(profilePath, 'utf8')
      );

      return {
        success: true,
        profile
      };
    } catch (error) {
      return {
        success: false,
        error: error.message
      };
    }
  }
};

