To center an item in CSS, you‚Äôve got a few handy options depending on the layout:

- **Flexbox (for both horizontal and vertical centering):**

```css
.container {
  display: flex;
  justify-content: center; /* centers horizontally */
  align-items: center;     /* centers vertically */
  height: 100vh;           /* needed if you want full-height centering */
}
```

- **Grid (also both axes):**

```css
.container {
  display: grid;
  place-items: center;
}
```

- **Inline-block + text-align (horizontal only):**

```css
.container {
  text-align: center;
}

.item {
  display: inline-block;
}
```

- **Absolute positioning (when you know the item size):**

```css
.container {
  position: relative;
}

.item {
  position: absolute;
