- **Flexbox (horizontal + vertical centering):**
  ```css
  .container {
    display: flex;
    justify-content: center;
    align-items: center;
  }
  ```
  That will center everything inside `.container` on both axes.

- **Grid (very concise):**
  ```css
  .container {
    display: grid;
    place-items: center;
  }
  ```
  Same effect, but you don‚Äôt need separate align/justify rules.

- **If you only need horizontal centering** (like text or inline-block items), you can do:
  ```css
